2. Mechanism interactions: The proposer compares token contributions. By computing the difference (token_opp – token_self) the model captures a fairness metric (favorable to the opponent when positive and unfavorable when negative). Decision-making is assumed to stem from a latent utility that is linked to a binary “generosity” choice, where the probability of offering a higher percentage increases with token difference.
3. Mathematical form: The model computes a latent quantity using a linear combination of the token difference with two learnable parameters (an intercept α and slope β). This latent quantity is passed through a logistic function, yielding a probability between 0 and 1. Multiplying by 100 yields the predicted proposed percentage proposed_perc.
4. Calibration parameters: Two learnable parameters (α and β) are needed. Parameter α captures a baseline generosity when the token contributions are equal, while β captures the sensitivity of the proposal to differences in contributions.
5. Mapping to observable behavior: The proposed percentage provided by participants is modeled as a transformation of the fairness difference. The logistic conversion ensures the outcome is confined within [0, 100]. Observed variables token_self and token_opp are used directly to compute the difference that drives the proposal decision.

