def simulate_model(trial_data, alpha=0, beta=0):
    model_predictions = []
    for trial in trial_data:
        token_opp = trial.get("token_opp", 0)
        token_self = trial.get("token_self", 0)
        try:
            proposed_perc = 100 / (1 + math.exp(-(alpha + beta * (token_opp - token_self))))
            model_predictions.append(proposed_perc)
        except OverflowError:
            # Handle potential OverflowError from exp()
            if -(alpha + beta * (token_opp - token_self)) > 709:
                model_predictions.append(100) #Approximation for extremely large positive exponents.
            else:
                model_predictions.append(0) #Approximation for extremely large negative exponents.

    return model_predictions
